async () => {

			if(selectEntityCertIncorp.files.length === 1) {
				await JSObjectKYCEntityIndComp.deleteIfFileExist('COI');
		  	await	QueryInsertKYCEntityIndComp.run({ 
					docType: 'Certificate of Incorportation', 
					docPathFilename : selectEntityCertIncorp.files[0].name
				});
				QueryCertOfIncorp.run();
			}

			if(selectEntityArtOfAssoc.files.length === 1) {
				await JSObjectKYCEntityIndComp.deleteIfFileExist('MAA');
				await	QueryInsertKYCEntityIndComp.run({
					docType: 'Memorandum and Article of Association', 
					docPathFilename :selectEntityArtOfAssoc.files[0].name
				});
				QueryArtOfAssoc.run();
			}

			if(selectPAN.files.length === 1) {
				await JSObjectKYCEntityIndComp.deleteIfFileExist('PAN');
				await QueryInsertKYCEntityIndComp.run({
					docType: 'PAN',
					docPathFilename: selectPAN.files[0].name
				});
				QueryPAN.run();
			}

			if(selectPOA.files.length === 1) {
				await JSObjectKYCEntityIndComp.deleteIfFileExist('POA');
				QueryPOA.run ();
				await QueryInsertKYCEntityIndComp.run({ 
					docType: SelectPOADocName.selectedOptionValue,
					docPathFilename :selectPOA.files[0].name
				});
			}

			if(selectPOI === 1) {
				await JSObjectKYCEntityIndComp.deleteIfFileExist('POI');
				await QueryInsertKYCEntityIndComp.run({ 
					docType:SelectPOIDocName.selectedOptionValue,
					docPathFilename :selectPOI.files[0].name
				});
				QueryPOI.run();
			}

			if(selectListOfDirectors.files.length === 1) {
				await JSObjectKYCEntityIndComp.deleteIfFileExist('POI');
				await QueryInsertKYCEntityIndComp.run({ 
					docType:'List Of Directors',
					docPathFilename :selectListOfDirectors.files[0].name
				});
				QueryDirectorsList.run();
			}

			if(selectCanclChq.files.length === 1) {
				await JSObjectKYCEntityIndComp.deleteIfFileExist('CC');
				await QueryInsertKYCEntityIndComp.run({ 
					docType: 'Cancelled Cheque',
					docPathFilename: selectCanclChq.files[0].name
				});
				QueryCanclChq.run();
			}

			if(selectImpExpCert.files.length === 1) {
				await JSObjectKYCEntityIndComp.deleteIfFileExist('IEC');
				await QueryInsertKYCEntityIndComp.run({ 
					docType:'Import Export Certificate',
					docPathFilename :selectImpExpCert.files[0].name
				});
				QueryImpExpCert.run();
			}

			if(selectBoardResolution.files.length === 1) {
				await JSObjectKYCEntityIndComp.deleteIfFileExist('BR');
				QueryBoardResolution.run();
				await QueryInsertKYCEntityIndComp.run({ 
					docType:'Board Resolution',
					docPathFilename: selectBoardResolution.files[0].name
				});
			}

			if(selectBeneOwnDeclaration.files.length === 1) {
				await JSObjectKYCEntityIndComp.deleteIfFileExist('BOD');
				await QueryInsertKYCEntityIndComp.run({ 
					docType:'Beneficial Ownership Declaration',
					docPathFilename: selectBeneOwnDeclaration.files[0].name
				});
				QueryBeneDeclaration.run();
			}

			showAlert('KYC Documents Uploaded');
			navigateTo('Individual KYC Summary', {});
	}

